INSERT INTO `products` VALUES (24,'Adidas','2023-04-30 23:16:59.588778','Футболка adidas зеленая',25,3220,'Футболка 3-STRIPES TEE',1),(27,'Fila','2023-04-30 23:19:13.388338','Спортивные шорты FILA',28,1499,'Шорты спортивные',1),(30,'Adidas','2023-04-30 23:53:08.059531','Шиповки зальные выполнены из искусственной кожи. Подметка гарантирует отличное сцепление. Мягкий верх из синтетического материала повторяет форму стопы.',31,8540,'Шиповки PREDATOR EDGE.4 TF',1),(38,'Nike','2023-05-01 00:06:47.649688','Бутсы выполнены из мягкого синтетического материала с особой текстурой от пятки до носка. Материал обеспечивает касание, необходимое для креативной игры на высокой скорости. Универсальная накладка для игры на разных покрытиях с зоной Nike Aerotrak в передней части обеспечивает оптимальное сцепление с натуральным и искусственным газоном. Удобный внутренний слой облегает стопу, как вторая кожа. Стелька для легкости и амортизации. Накладка на носке для прочности.',39,1790,'Бутсы Jr. Mercurial Vapor 13 MG',1),(42,'Demix','2023-05-01 00:10:57.079662','Футбольные бутсы выполнены из искусственной кожи и текстиля. Модель подходит для игры в зале. Специальные желобки в подошве для гибкости. Детали: подкладка, резиновая подошва, вставки из воздухопроницаемой сетки, контрастный дизайн.',43,2600,'Бутсы зальные SALA BASE 2 JR',1);
